import reactDom from 'react-dom';

import IconDotLine from "./assets/icon-dot-line.png";
import './background.css';

export default function Background(){

    return(
        <div className = "Background">   
        <div className = "IconSetup">
            <img src = {IconDotLine} />
            </div>
            </div>

    );
}
